import React from "react";
import image from "../../assets/images/ep-logo-green.svg";
import classes from "./Logo.module.css";

const logo = props => {
  switch (props.type) {
    case "logo":
      return <img src={image} alt="logo" className={classes.Logo} />;
    case "team-mystic ":


      return;
  }
};

export default logo;
